    const playerList = ["µ", "StrongApe", "Protect Jhin", "Not Depression", "DunkTown Xpress", "Big Drip 808", "ShirosCloud", "KurosCloud", "ezy af"];
  
    return (
      <div className="myslibros-container">
        <div className="myslibros-header">
          <h1>µslibros</h1>
        </div>
        <div className="myslibros-content-container">
          <LeagueProfile leagueName="ezy af" />
          <LeagueProfile leagueName="µ" />
          <LeagueProfile leagueName="Protect Jhin" />
          {/*<LeagueProfile leagueName="Not Depression" />
          <LeagueProfile leagueName="DunkTown Xpress" />
    <LeagueProfile leagueName="Big Drip 808" />*/} 
